import React from "react";
import Card from "./Card";
import {Colordata} from './Colordata';

const App = () => {
    return(
        <>
           <h1> Color Picker </h1>
            {Colordata.map((val) => {
               return <Card 
               key={val.id}
               color={val.color}
               name={val.name} 
               />
        })}
        </>
    )
}

export default App;
